import { NavLink } from 'react-router-dom';
impo

function Nav(){
return (
    <nav>
    <ul>
        <li><NavLink to="/">Home</NavLink></li>
        <li><NavLink to="/CadastroLivros">Cadastro de Livros</NavLink></li>
        <li><NavLink to="/CadastroLeitores">Cadastro de Leitores</NavLink></li>
    </ul>
    </nav>
  );
}

export default Nav;
